import React, {useRef} from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {
  const nav = useRef();
  const logo = useRef();

  const showNavbar = () => {
    nav.current.classList.toggle("responsive_nav");
    logo.current.classList.toggle("hide_logo");
  };
  return (
    <div>
      <div className="container" id="container">
        
        <img ref={logo} className="doglogo push" src="/doglogo.png" alt="logo"></img>
        <button className="loginn ">Login</button>
        <button className="signupp=">Sign Up</button>

        <button className="hide_button" onClick={showNavbar}><FaBars />
</button>
      
      </div>
    </div>
  );
}

export default Navbar;
